import { Link, DirectLink, Element, Events, animateScroll as scroll, scrollSpy, scroller } from "react-scroll";
import './Header.scss'
import { useRouter, Router } from "next/router";
import { useState, useEffect, Component } from "react";

export default class Navbar extends Component {
    scrollToTop = () => {
      scroll.scrollToTop();
    };
  
    render() {
      return (
        <nav className="nav" id="navbar">
          <div className="nav-content">
            <img
              src={logo}
              className="nav-logo"
              alt="Logo"
              onClick={this.scrollToTop}
            />
            <ul className="nav-items">
              <li className="nav-item">
                <Link
                  activeClass="active"
                  to="section1"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                >
                  Section 1
                </Link>
              </li>
              <li className="nav-item">
                <Link
                  activeClass="active"
                  to="section2"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                >
                  Section 2
                </Link>
              </li>
              <li className="nav-item">
                <Link
                  activeClass="active"
                  to="section3"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                >
                  Section 3
                </Link>
              </li>
              <li className="nav-item">
                <Link
                  activeClass="active"
                  to="section4"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                >
                  Section 4
                </Link>
              </li>
              <li className="nav-item">
                <Link
                  activeClass="active"
                  to="section5"
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={500}
                >
                  Section 5
                </Link>
              </li>
            </ul>
          </div>
        </nav>
      );
    }
  }



export default Header;
